        price: "$0+",
        bedrooms: "0+",
        home_type: "House",
        bathrooms: "0+",
        sqft: "1000+",
        days_listed: "1 or less",
        has_photos: "1+",
        open_house: "false",
        keywords: "",
    });
    
    const {sale_type, price, bedrooms, home_type, bathrooms, sqft, days_listed, has_photos, open_house, keywords} = formSata;
